I registered it with "difluorideApp" and did recompile it in between. i also did make clear in between to ensure that it was redone.
Example code:
#include "DiffusionCoupled.h"
// Don't forget to register your object with MOOSE
registerMooseObject("difluorideApp", DiffusionCoupled);

Hi @amassaf, in case you haven't already found this class, you can use ComputeUpdatedEulerAngle to output the updated euler angles. However, this information will be similar to what you have seen in paraview.
Because the stress-update based crystal plasticity code is written to refer to the reference configuration, we only calculate the rotation of the Rank-4 elasticity tensor once at the beginning of the simulation. Updates to the rotation matrix are computed in the ComputeMultipleCrystalPlasticityStress class https://github.com/idaholab/moose/blob/next/modules/solid_mechanics/src/materials/crystal_plasticity/ComputeMultipleCrystalPlasticityStress.C#L315-L317
@dewenyushu do you have insights into how to update the Rank-4 elasticity tensor from the _updated_rotation[_qp] Rank-2 tensor?
